    bytes32 public str32 = "hello ether";

    uint8 public v=128;
    address public mydd = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;

    struct Mystruct{
        uint256 n;
        string strl;
    }

    Mystruct public mystruct = Mystruct(1, "vivek") ;
}

